import { UserContext } from "../App";

const Footer = () => {
  const { state, dispatch } = useContext(UserContext);
  
    return (
        <footer className="page-footer blue-grey darken-1">
            <div className="container">
                <div className="row">
                <div className="col l6 s12">
                    <h5 className="white-text">Use Mine</h5>
                    <p className="grey-text text-lighten-4">פלטפורמה להשכרה ולהשאלה של ציוד</p>
                </div>
                <div className="col l4 offset-l2 s12">
                    <h5 className="white-text">קישור לאתר המכללה</h5>
                    <ul>
                    <li><a className="grey-text text-lighten-3" href="#!">Link 1</a></li>
                    <li><a className="grey-text text-lighten-3" href="#!">Link 2</a></li>
                    <li><a className="grey-text text-lighten-3" href="#!">Link 3</a></li>
                    <li><a className="grey-text text-lighten-3" href="#!">Link 4</a></li>
                    </ul>
                </div>
                </div>
            </div>
            <div className="footer-copyright">
                <div className="container">
                © 2020 כל הזכויות שמורות
                <a className="grey-text text-lighten-4 right" href="#!">More Links</a>
                </div>
            </div>
            </footer>
    );
};

export default Footer;
